import React from "react";
import classes from "./AddSubTaskButton.module.css";

const AddSubTaskButton = (props) => {
  return (
    <div className={classes["add-subtask-button"]}>
      <button className={classes.addTask}>
        <a href="" className={classes.buttonLable}>
          + Add Sub-task
        </a>
      </button>
    </div>
  );
};

export default AddSubTaskButton;
